import { Button, Container, Form, Row, Col, Table } from "react-bootstrap";
import { useState } from "react";
export default function TabelaDoadores(props) {
    const [doadores, setDoadores] = useState(props.listaDoadores);

    function excluirDoador(cpf) {
        const listaAtualizada = props.listaDoadores.filter((doador) => doador.cpf !== cpf);
        props.setDoadores(listaAtualizada);
        setDoadores(listaAtualizada);
    }
    function filtrarDoadores(e) {
        const termoBusca = e.currentTarget.value;
        const resultadoBusca = props.listaDoadores.filter((doador) => doador.nome.toLowerCase().includes(termoBusca.toLowerCase()));
        setDoadores(resultadoBusca);
    }
    return (
        <Container className="m-3">
            <center><Button onClick={() => {
                props.exibirTabela(false);
            }}>
                Cadastrar
            </Button></center>
            <Container className="m-3">
                <Row>
                    <Col>
                        <Form.Control type="text" id="termoBusca" onChange={filtrarDoadores} />
                    </Col>

                </Row>
            </Container>

            <Table striped bordered hover>

                <thead>
                    <tr>
                        <th><center>Nome</center></th>
                        <th ><center>CPF</center></th>
                        <th><center>Data nasc.</center></th>
                        <th><center>Genero</center></th>
                        <th><center>Endereço</center></th>
                        <th><center>Bairro</center></th>
                        <th><center>CEP</center></th>
                        <th><center>Cidade</center></th>
                        <th><center>UF</center></th>
                        <th><center>Ações</center></th>
                    </tr>
                </thead>

                <tbody>
                    {
                        doadores?.map((doador) => {
                            return <tr key={doador.cpf}>
                                <td>{doador.nome}</td>
                                <td>{doador.cpf}</td>
                                <td>{doador.datanasc}</td>
                                <td>{doador.genero}</td>
                                <td>{doador.endereco}</td>
                                <td>{doador.bairro}</td>
                                <td>{doador.cep}</td>
                                <td>{doador.cidade}</td>
                                <td>{doador.uf}</td>
                                <td>
                                    <div className="btn-group">
                                        <center><Button><svg xmlns="http://www.w3.org/2000/svg"
                                            width="16"
                                            height="16"
                                            fill="currentColor"
                                            className="bi bi-pencil"
                                            viewBox="0 0 16 16">
                                            <path d="M12.146.146a.5.5 0 0 1 .708 0l3 3a.5.5 0 0 1 0 .708l-10 10a.5.5 0 0 1-.168.11l-5 2a.5.5 0 0 1-.65-.65l2-5a.5.5 0 0 1 .11-.168l10-10zM11.207 2.5 13.5 4.793 14.793 3.5 12.5 1.207 11.207 2.5zm1.586 3L10.5 3.207 4 9.707V10h.5a.5.5 0 0 1 .5.5v.5h.5a.5.5 0 0 1 .5.5v.5h.293l6.5-6.5zm-9.761 5.175-.106.106-1.528 3.821 3.821-1.528.106-.106A.5.5 0 0 1 5 12.5V12h-.5a.5.5 0 0 1-.5-.5V11h-.5a.5.5 0 0 1-.468-.325z" />
                                        </svg>
                                        </Button></center>

                                        <center><Button className="btn btn-danger" onClick={() => {
                                            if (window.confirm("Deseja excluir?")) {
                                                excluirDoador(doador.cpf);
                                            }
                                        }}>
                                            <svg xmlns="http://www.w3.org/2000/svg"
                                                width="16"
                                                height="16"
                                                fill="currentColor"
                                                className="bi bi-trash3"
                                                viewBox="0 0 16 16">
                                                <path d="M6.5 1h3a.5.5 0 0 1 .5.5v1H6v-1a.5.5 0 0 1 .5-.5ZM11 2.5v-1A1.5 1.5 0 0 0 9.5 0h-3A1.5 1.5 0 0 0 5 1.5v1H2.506a.58.58 0 0 0-.01 0H1.5a.5.5 0 0 0 0 1h.538l.853 10.66A2 2 0 0 0 4.885 16h6.23a2 2 0 0 0 1.994-1.84l.853-10.66h.538a.5.5 0 0 0 0-1h-.995a.59.59 0 0 0-.01 0H11Zm1.958 1-.846 10.58a1 1 0 0 1-.997.92h-6.23a1 1 0 0 1-.997-.92L3.042 3.5h9.916Zm-7.487 1a.5.5 0 0 1 .528.47l.5 8.5a.5.5 0 0 1-.998.06L5 5.03a.5.5 0 0 1 .47-.53Zm5.058 0a.5.5 0 0 1 .47.53l-.5 8.5a.5.5 0 1 1-.998-.06l.5-8.5a.5.5 0 0 1 .528-.47ZM8 4.5a.5.5 0 0 1 .5.5v8.5a.5.5 0 0 1-1 0V5a.5.5 0 0 1 .5-.5Z" />
                                            </svg>
                                        </Button></center>
                                    </div>
                                </td>
                            </tr>
                        })
                    }
                </tbody>
            </Table>
        </Container>
    );
}
